Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('24','3','Quelle est la différence entre cashback et remboursement?','Ces deux termes sont employés indifféremment dans l''application. Ils désignent tous deux le montant dont vous bénéficierez après avoir effectué un achat, avec votre carte bancaire, qui remplit les conditions imposées par les offres  des enseignes partenaires de l''application.','1');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('25','6','Est-ce que je peux accéder à Mes bons plans depuis un ordinateur ou depuis une tablette?','L''application Mes bons plans est disponible uniquement depuis un Smartphone, sous iOS ou Android.','1');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('26','7','Un/e collègue a entendu parler de "Mes bons plans" et souhaite aussi utiliser l''application mobile. Comment l''aider à s''inscrire?','S''il s''agit bien d''un collaborateur de lun des 3 établissements ci-après, titulaire d''un compte de dépôt et d''une carte bancaire émise par la Banque Populaire Rives de Paris, la BRED ou la Caisse d''Epargne Ile-de-France, alors votre collègue est éligible. Vous pouvez lui conseiller d''écrire à support-mesbonsplans@paymentsolutions.natixis.com en nous indiquant une adresse email de contact ainsi qu''un numéro de portable. Nous prendrons contact avec votre collègue pour traiter sa demande d''inscription.','1');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('27','1','Comment est calculé mon cashback ?','Le montant du cashback est calculé en fonction du montant de votre achat effectué chez lEnseigne partenaire (hors taxes, hors frais de port et réductions) et du pourcentage indiqué dans les conditions de l''offre. S''il s''agit d''un montant nominal, vous bénéficierez de ce montant en euros, si les conditions de l''offre sont bien remplies.','3');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('28','2','Comment suivre l''état de la validation de mes remboursements?','Dans l''espace Remboursements, vous accédez à l''historique de vos achats réalisés, répartis par mois. Vous pouvez suivre le statut de votre cashback dans les différentes rubriques : - "Montant en cours de validation", l''enseigne n''a pas encore confirmé le caractère définitif de l''achat et du paiement. Ce statut est provisoire et permet à l''enseigne de vérifier que l''achat a été réalisé selon les conditions requises.  - "Montant remboursé", le cashback correspondant vous a été versé sur votre compte bancaire. - "Montant refusé", le cashback correspondant a été refusé par l''enseigne car la commande ou le paiement n''ont pas été validés (par exemple : retour produit)','3');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('29','3','Pourquoi l''état de mon cashback est-il « en cours de validation » dans la rubrique Remboursements?','Tant que lEnseigne partenaire na pas confirmé le caractère définitif de votre achat et du paiement, le cashback correspondant apparait sous le statut «Montant en cours de validation» dans la rubrique Remboursements. Ce statut est provisoire. Ce délai permet à lEnseigne partenaire de vérifier que votre achat a été réalisé selon les conditions requises. Ce délai de validation du cashback par l''Enseigne partenaire est compris entre 10 et 70 jours, hormis pour les offres proposées par les enseignes de type hôtels, voyagistes ou fournisseurs de services, pour lesquelles la validation peut être réalisée dans un délai d''un (1) mois minimum après le retour du séjour ou la  consommation de la  prestation.','3');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('30','4','Pourquoi mon cashback a-t-il été refusé par l''enseigne ?','Vous n''avez peut-être pas respecté les conditions de l''offre de l''enseigne. Nous vous invitons à vérifier le détail des conditions de cette offre. Plusieurs raisons (liste non exhaustive) peuvent expliquer que votre cashback ait été refusé :  - vous n''avez pas visualisé l''offre sur l''application Mes Bons Plans; - vous avez retourné votre article ou annulé votre achat ; - votre achat ne correspond pas aux conditions de l''offre fixées par l''enseigne; - votre achat n''a pas été payé dans son intégralité, par exemple chez une enseigne voyagiste.','3');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('31','5','Pourquoi mon achat n''apparaît-il pas dans l''historique de mes achats ?','Lorsque vous effectuez un achat chez une enseigne partenaire, le montant éligible apparaît dans la rubrique "Remboursements" dans un délai de 2 jours ouvrables maximum. Si votre achat n''apparaît pas dans l''historique de vos achats, dans un délai de 5 jours ouvrables, vous pouvez contacter le Service Support Mes bons plans par email support-mesbonsplans@paymentsolutions.natixis.com. Veillez à indiquer l''adresse email saisie lors de votre inscription, le nom de votre établissement bancaire et un numéro de téléphone pour vous joindre.','3');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('32','6','J''ai annulé un achat ou retourné un article. Que se passe-t-il ?','Le montant de votre cashback sera refusé par l''enseigne. Cette information sera visible dans la rubrique Remboursements, avec le statut "Montant refusé". Vous ne bénéficierez pas du cashback.','3');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('33','7','Comment suis-je crédité(e) de mon cashback validé et sous quels délais ?','Vous n''avez aucune action à effectuer pour récupérer votre cashback.  A chaque début de mois,  le montant total des cashback cumulés sur un mois est automatiquement crédité sur votre compte bancaire enregistré lors de votre inscription, sous réserve de validation par chaque enseigne du cashback. Ce délai de validation est compris entre 10 et 70 jours à compter de l''achat.','3');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('34','1','Comment dois-je utiliser mon cashback?','Le montant qui est versé chaque mois sur votre compte bancaire peut être dépensé comme vous le souhaitez. Vous n''avez aucune obligation de le dépenser sur des offres de l''application Mes bons plans.','4');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('35','2','Est-ce qu''il y a une date limite d''utilisation du cashback viré sur mon compte?','Il n''y a pas de date limite d''utilisation du montant de cashback viré sur votre compte. Vous êtes libre de l''utiliser lorsque vous le souhaitez.','4');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('36','1','J''ai perdu mon mot de passe, que dois-je faire?','Vous pouvez contacter le service support à l''adresse email support-mesbonsplans@paymentsolutions.natixis.com en indiquant l''adresse email saisie lors de votre inscription et le nom de votre établissement bancaire.','6');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('37','2','Je souhaite modifier ma carte bancaire enregistrée dans l''application "Mes bons plans", que dois-je faire ?','Vous devez contacter le service support à l''adresse email support-mesbonsplans@paymentsolutions.natixis.com en indiquant l''adresse email saisie lors de votre inscription, le nom de votre établissement bancaire et un numéro de téléphone. Nous prendrons contact avec vous pour traiter votre demande.','6');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('1','1','Qu''est-ce que Mes bons plans?','C''est une application mobile gratuite permettant aux titulaires d''une carte bancaire d''un établissement du Groupe BPCE de bénéficier d''offres de cashback à l''issue d''achats réalisés chez des enseignes partenaires.','1');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('19','3','Y a-t-il une obligation d''achat si j''active une offre d''un commerçant partenaire ?','Il n''y a aucune obligation d''achat à la suite de l''activation d''une offre d''un commerçant partenaire. Cette activation ne vous engage aucunement et vous êtes libre d''effectuer ou non votre achat chez le commerçant par la suite.','2');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('16','5','Comment être utilisateur de l''application Mes bons plans?','Toute personne physique majeure et capable, collaborateur et titulaire d''un compte de dépôt et d''une carte bancaire émise par la Banque Populaire Rives de Paris, la BRED ou la Caisse d''Epargne Ile-de-France, peut utiliser l''application Mes bons plans.','1');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('21','5','J''ai effectué un achat avec un moyen de paiement différent de ma carte bancaire BRED, Caisse d''Epargne Ile-de-France ou Banque Populaire Rives de Paris, puis-je bénéficier de mon cashback?','Vous ne pourrez pas bénéficier de votre cashback. Vous devez utiliser la carte bancaire qui est enregistrée dans l''application.','2');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('13','2','Qu''est-ce que le "cashback"?','Il s''agit d''un remboursement différé dont le montant correspond soit à un pourcentage du montant de votre achat, soit à un montant nominal net de TVA,  réalisé auprès d''une enseigne partenaire, référencée par une offre, dans l''application mobile "Mes bons plans".','1');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('18','2','Combien d''offres de commerçants partenaires puis-je activer ?','Il n''y a pas de limite au nombre d''offres dont vous pouvez bénéficier. Les offres vous permettent de bénéficier de cashback sur vos achats mais ne sont pas une incitation à la consommation abusive de produits chez les partenaires référencés.','2');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('15','4','Comment ça marche?','Les offres proposées par les enseignes partenaires sont visibles par vous dans l''application. Les conditions des offres varient en fonction de l''enseigne partenaire qui la propose et définissent ses conditions de validité.  Afin de pouvoir bénéficier d''une offre de cashback, vous devez tout d''abord la visualiser sur l''application puis payer vos achats en magasin avec la carte bancaire enregistrée dans l''application.','1');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('17','1','Dois-je systématiquement consulter une offre avant mon achat avec Mes bons plans pour bénéficier du cashback ?','Il existe 2 types d''offres :  - les offres avec un il grisé : ces offres doivent obligatoirement être consultées avant votre achat  afin de pouvoir bénéficier du cashback. La visualisation est actée par l''il qui devient violet. Vous pourrez ensuite bénéficier du cashback correspondant (selon les conditions de l''offre)  - Les offres sans il grisé : ces offres ne nécessitent pas d''être consultées. Vous pouvez bénéficier du cashback correspondant (selon les conditions de l''offre)','2');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('20','4','Ai-je besoin de présenter une preuve de l''activation de mon offre au moment de l''achat pour bénéficier de mon cashback ?','Il n''est pas nécessaire de présenter une preuve d''activation de l''offre. Pour bénéficier du cashback, après avoir consulté l''offre, il vous suffit de payer avec votre carte bancaire enregistrée dans l''application.','2');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('22','1','Comment sont traitées mes données personnelles dans l''application Mes bons plans?','Vos données personnelles sont utilisées pour vous proposer des offres promotionnelles personnalisées en fonction des achats que vous avez réalisés avec votre carte bancaire et pour assurer la gestion de votre compte personnel.  Les informations que nous collectons servent à vous proposer des offres pertinentes. Il peut s''agir d''informations comme votre nom, votre code postal, votre adresse e-mail, votre numéro de téléphone, vos données GPS ainsi que les achats que vous avez effectués avec votre carte bancaire.','5');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('23','3','Quels sont les engagements de sécurité pour mes informations personnelles ?','Vos données personnelles ne seront utilisées daucunes autres manières, seules les statistiques sur les catégories dachats seront utilisées afin de vous proposer des offres ciblées. Sachez que des fonctionnalités permettant de gérer vos données à caractère personnel et de protéger votre paramètres de confidentialité et de sécurité sont disponibles dans la section Mon compte>Réglages.','5');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('39','3','J''ai perdu ma carte bancaire, que dois-je faire? Puis-je continuer à utiliser l''application "Mes bons plans"?','En cas de perte ou vol de votre carte bancaire, vous devez faire une demande de mise en opposition auprès de votre établissement. Pour pouvoir continuer à utiliser l''application "Mes bons plans", vous devez contacter le service support à l''adresse email support-mesbonsplans@paymentsolutions.natixis.com en indiquant l''adresse email saisie lors de votre inscription, le nom de votre établissement bancaire et un numéro de téléphone. Nous prendrons contact avec vous pour traiter votre demande.','6');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('40','4','Ma carte bancaire arrive à expiration, que dois-je faire pour continuer à utiliser l''application "Mes bons plans" ?','Vous devez contacter le service support à l''adresse email support-mesbonsplans@paymentsolutions.natixis.com en indiquant l''adresse email saisie lors de votre inscription, le nom de votre établissement bancaire et un numéro de téléphone. Nous prendrons contact avec vous pour traiter votre demande.','6');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('5','3','J''ai perdu mon Smartphone, que dois-je faire?','En cas de vol, il ne sera pas possible d''utiliser l''application "Mes bons plans" pour utiliser frauduleusement votre carte bancaire. En revanche, vous devez signaler la perte de votre Smartphone auprès des autorités compétentes. Pour pouvoir continuer à utiliser l''application "Mes bons plans", vous devez contacter le service support à l''adresse email support-mesbonsplans@paymentsolutions.natixis.com en indiquant l''adresse email saisie lors de votre inscription, le nom de votre établissement bancaire et un numéro de téléphone. Nous prendrons contact avec vous pour traiter votre demande.','7');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('3','1','J''ai perdu mon mot de passe, que dois-je faire?','Vous pouvez contacter le service support à l''adresse email support-mesbonsplans@paymentsolutions.natixis.com en indiquant l''adresse email saisie lors de votre inscription et le nom de votre établissement bancaire.','7');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('4','2','J''ai perdu ma carte bancaire, que dois-je faire?','En cas de perte ou vol de votre carte bancaire, vous devez faire une demande de mise en opposition auprès de votre établissement. Pour pouvoir continuer à utiliser l''application "Mes bons plans", vous devez contacter le service support à l''adresse email support-mesbonsplans@paymentsolutions.natixis.com en indiquant l''adresse email saisie lors de votre inscription, le nom de votre établissement bancaire et un numéro de téléphone. Nous prendrons contact avec vous pour traiter votre demande.','7');
Insert into ER1OA.QUESTION_FAQ (ID,ORDRE,QUESTION,REPONSE,THEMEFAQ_ID) values ('6','2','Pendant combien de temps sont conservées mes données?','Dans le cadre de ce Service, vos données à caractère personnel seront conservées : -    Pour les données de compte, pendant la durée de lutilisation du service ; -    Pour les données concernant les paiements, pour une durée de deux ans à compter de la transaction.','5');
